import{_ as e,o as i,c as l,S as a}from"./chunks/framework.7f03344f.js";const u=JSON.parse('{"title":"END-8-2 鸣谢与后记","description":"","frontmatter":{},"headers":[],"relativePath":"Volume9/END-8-2.md","filePath":"docs/Volume9/END-8-2.md","lastUpdated":1698403164000}'),t={name:"Volume9/END-8-2.md"},o=a('<h1 id="end-8-2-鸣谢与后记" tabindex="-1">END-8-2 鸣谢与后记 <a class="header-anchor" href="#end-8-2-鸣谢与后记" aria-label="Permalink to &quot;END-8-2 鸣谢与后记&quot;">​</a></h1><p>咦？你还是看到这里来了？</p><p>那好吧，我就随便说说了。</p><p>这份教程的编写，离不开这些个人、组织、项目、服务的帮助：</p><ul><li>Node.js，基于 Chrome V8 引擎的 JavaScript 运行时</li><li>Cloudflare Pages，托管本站点的页面</li><li>JsDelivr，全球皆可使用的 JavaScript CDN</li><li>Docsify，绘制了本教程页面的结构</li><li>Font Awesome，虽然很少用到，但还是谢谢你们的作品</li><li>Fira Code 字体是本站的主要字体，我觉得看上去还挺好看的</li><li>Typora，本教程的大部分内容都是在这里编写的</li><li>Mojang Studios 和 Microsoft，感谢你们开发出 Minecraft 这么好的游戏</li><li>tdiant，来自这位开发人员的教程帮助了我很多</li><li>Bukkit、Spigot 和 Paper，感谢你们的努力付出</li><li>JetBrains，感谢你们的巨作 IntelliJ IDEA</li><li>Apache，感谢你们的 Maven 这一天才想法</li><li>OpenJDK 社区、Eclipse 基金会、IBM 和所有为了 OpenJDK 与 OpenJ9 努力付出过的人，谢谢你们</li><li>洞穴夜莺和 William_Shi，为本教程指出了许多错误</li><li>dengyu、土球球等 MCBBS 编程开发版的版主，感谢你们的建议</li></ul><p>当然，最重要的还是正在阅读本教程的你，谢谢你的陪伴。</p><p>本教程肯定写得没有那么好，如果给你的阅读带来了麻烦，我深感抱歉，但笔者确实已经尽了最大的努力。</p><p>教程中插入的那些歌曲都是我喜欢听的，我觉得它们能够鼓励你继续向前，当然，如果你觉得不好听也可以把它们关上。</p><p><span style="color:#df307f;">#df307f</span> 是我最喜欢的颜色。</p><p>欢迎来 MCBBS 找我玩~我的主页：<a href="https://www.mcbbs.net/home.php?mod=space&amp;uid=3281025" target="_blank" rel="noreferrer">https://www.mcbbs.net/home.php?mod=space&amp;uid=3281025</a></p><hr><blockquote><p>现在该说再见了！Bye~❤</p></blockquote>',12),p=[o];function r(s,n,c,d,_,m){return i(),l("div",null,p)}const f=e(t,[["render",r]]);export{u as __pageData,f as default};
